  true,\n\t\"url\": null,\n\t\"notes\": \"The NOAA UHF 449 Profiler data was collected
  during the NASA supported Midlatitude Continental Convective Clouds Experiment (MC3E).
  \ The Ultra High Frequency 449 MHz profiler was one of three NOAA deployed instruments
  which also included a Parsivel and a 2.8 GHz profiler (S-Band).  The 449 MHz profiler
  raw data files provide estimates of the vertical air motion during precipitation
  from near the surface to just below the freezing level.  Used together with the
  S-band profiler, vertical profiles of raindrop size distributions can be retrieved.
  \ The raw 449MGx profiler data consists of uncalibrated Doppler velocity spectra
  data in units of relative power return.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
